import React from 'react'
import Navigation from '../Component/navigation/Navigation'
import { useSelector } from 'react-redux'


function ImageHistory() {
  // const images = useSelector(state => state.galleryImages.images)
  const galleryImages = useSelector(state => state.galleryImages)
  console.log('title is', galleryImages)
  return (
   <>
    <div>
      <Navigation/>
      <h2>images history </h2>
      <h5>{galleryImages.map((item, index) => (
        <div key={index}>
          {item.title}
          {item.images?.map((items,index)=>(
            <div key={index}>
              <img src={items.images} alt=""/>
              <img src="https://images.unsplash.com/photo-1503023345310-bd7c1de61c7d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MXx8aHVtYW58ZW58MHx8MHx8&w=1000&q=80" alt=""/>
            </div>
          ))}
        </div>
      ))}</h5>
      {/* <h6>
        {
          galleryImages.images.map((img.index)=>(
            <div>
              {img.images}
            </div>
          ))
        }
      </h6> */}
    </div>
   </>
  )
}



export default ImageHistory
